import React from "react";
import Logo from './Images/writes.png';
import './index.css';
import Footer from "./Footer";


const Header = () => {

  return(
    <>  
    <div className="header">
      <div><img src={Logo} alt="Writes" height="60px" width="60px"/></div>
          <div><h1>Writes</h1></div>
          </div>  
          <Footer/>
    </>
  ) 
}
export default  Header;
